import React from "react";
import Radio from "../../../components/radio/Radio";


const Field=()=>{


    return(
        <div className="container-box">
            <Radio id="computerScience" name="field" value="computerScience"/>
            <Radio id="Maths" name="field" value="maths"/>
            <Radio id="socialScience" name="field" value="socialScience"/>
            <Radio id="business" name="field" value="business"/>
            <Radio id="fineArts" name="field" value="fineArts"/>
            <Radio id="education" name="field" value="computerScience"/>
        </div>
    )
}

export default Field;
